mauvais_points:
La porte de la chambre était ouverte quand je suis arrivée; une bouteille d'eau sur la table était entamée.
Pas de savon dans le support de la douche. 
Personnel peu attentif au client limite méprisant;

bons_points:
La propreté, le confort de la chambre et du lit;
excellent rapport qualité prix.
J’y viens depuis plusieurs années chaque fois que j’ai un avion à prendre à Orly ou Roissy. Proximité des navettes aéroports.

