excellent rapport qualité prix.
J’y viens depuis plusieurs années chaque fois que j’ai un avion à prendre à Orly ou Roissy. Proximité des navettes aéroports.

Personnel: très accueillant, particulièrement attentif et professionnel;
Chambre confortable: lit de très bonne qualité, assez de rangements, salle de bain spacieuse avec grande douche efficace;
Rue calme donc peu de bruit; proximité métro et nombreux restaurant.
Très bon séjour.

mauvais_points:
Petits bémols seulement:
L’isolation sonore entre les chambres pourrait être meilleure (je pouvais entendre la conversation des voisins);
La chambre était petite comme souvent à Paris : peu de place autour du lit (OK pour une personne mais pour deux?)
